PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE room_master_table (id INTEGER PRIMARY KEY,identity_hash TEXT);
CREATE TABLE `Meal` (`id` INTEGER NOT NULL, `userId` INTEGER NOT NULL, `date` TEXT, `brand` INTEGER NOT NULL, `calorieGoal` INTEGER NOT NULL, `measureCount` INTEGER NOT NULL, `mealNameId` INTEGER NOT NULL, `mealNameRank` INTEGER NOT NULL, `calories` REAL, `sodium` REAL, `potassium` REAL, `carbs` REAL, `vitaminA` REAL, `vitaminC` REAL, `calcium` REAL, `iron` REAL, `fat` REAL, `saturatedFat` REAL, `polyunsaturedFat` REAL, `monounsaturatedFat` REAL, `transFat` REAL, `cholesterol` REAL, `fiber` REAL, `sugars` REAL, `protein` REAL, `createdDate` INTEGER, `modifiedDate` INTEGER, `enrich` INTEGER NOT NULL, PRIMARY KEY(`id`));
CREATE TABLE `MealName` (`id` INTEGER NOT NULL, `userId` INTEGER NOT NULL, `rank` INTEGER NOT NULL, `name` TEXT, `createdDate` INTEGER, `modifiedDate` INTEGER, `brand` INTEGER NOT NULL, PRIMARY KEY(`id`));
CREATE TABLE `WorkoutLocation` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `userId` INTEGER NOT NULL, `date` INTEGER NOT NULL, `speed` REAL NOT NULL, `horizontalAccuracy` REAL NOT NULL, `altitude` REAL NOT NULL, `verticalAccuracy` REAL NOT NULL, `latitude` REAL NOT NULL, `longitude` REAL NOT NULL, `synced` INTEGER NOT NULL);
CREATE TABLE `Plan` (`id` INTEGER NOT NULL, `accountId` INTEGER, `deviceId` INTEGER, `state` TEXT NOT NULL, `type` INTEGER NOT NULL, `startDate` INTEGER, PRIMARY KEY(`id`));
CREATE TABLE `Section` (`tag` TEXT NOT NULL, `orderId` INTEGER NOT NULL, `name` TEXT NOT NULL, `description` TEXT NOT NULL, `layoutFormatId` INTEGER NOT NULL, PRIMARY KEY(`tag`));
CREATE TABLE `VasistasSource` (`deviceId` INTEGER NOT NULL, `vasistasCategory` INTEGER NOT NULL, `userId` INTEGER NOT NULL, `devicePriority` INTEGER NOT NULL, `timestamp` INTEGER NOT NULL, PRIMARY KEY(`deviceId`, `vasistasCategory`));
CREATE TABLE `NoteGroup` (`noteGroupId` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `wsId` INTEGER, `userId` INTEGER, `measureGroupId` INTEGER NOT NULL, `localMeasureGroupId` INTEGER, `localEcgId` INTEGER, `cryptpart` TEXT, `date` INTEGER NOT NULL, `serverCreatedDate` INTEGER, `serverModifiedDate` INTEGER, `localModifiedDate` INTEGER, `noSymptom` INTEGER NOT NULL, `signalId` INTEGER, `deleted` INTEGER NOT NULL, `synced` INTEGER NOT NULL);
CREATE TABLE `NoteEntity` (`noteId` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `noteWsId` INTEGER, `noteGroupId` INTEGER, `localNoteGroupId` INTEGER, `noteDeleted` INTEGER NOT NULL, `type` INTEGER NOT NULL, `text` TEXT, `noteHealthAttributeId` INTEGER, `signalId` INTEGER, `modified` INTEGER NOT NULL);
CREATE TABLE `EcgMeasurement` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `userID` INTEGER NOT NULL, `deviceModel` INTEGER NOT NULL, `timestamp` INTEGER NOT NULL, `diagnostic` INTEGER, `heartRate` INTEGER NOT NULL, `synced` INTEGER NOT NULL, `modified` INTEGER NOT NULL, `deviceId` INTEGER, `trackerWearPos` INTEGER, `deleted` INTEGER NOT NULL, `signalId` INTEGER, `signalPath` TEXT NOT NULL, `timeWindow` INTEGER NOT NULL, `duration` INTEGER NOT NULL, `totalSize` INTEGER NOT NULL, `offset` INTEGER NOT NULL, `gain` INTEGER NOT NULL, `qfix` INTEGER NOT NULL, `type` INTEGER NOT NULL, `samplingFreq` INTEGER NOT NULL, `channel` INTEGER NOT NULL, `format` INTEGER NOT NULL, `size` INTEGER NOT NULL, `resolution` INTEGER NOT NULL, `filterBank` INTEGER NOT NULL);
CREATE TABLE `Track` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `wsId` INTEGER, `userId` INTEGER NOT NULL, `startDate` INTEGER NOT NULL, `endDate` INTEGER NOT NULL, `timeZone` TEXT, `day` TEXT NOT NULL, `modifiedDate` INTEGER NOT NULL, `deviceModel` INTEGER NOT NULL, `deviceType` INTEGER NOT NULL, `attrib` INTEGER NOT NULL, `category` INTEGER NOT NULL, `dataJson` TEXT, `activityRecognitionVersion` INTEGER, `isSyncedToWs` INTEGER NOT NULL, `deleted` INTEGER NOT NULL, `deletionReason` INTEGER, `note` TEXT, `snoringEnabled` INTEGER NOT NULL, `inProgress` INTEGER NOT NULL, `manualStartDate` INTEGER, `manualEndDate` INTEGER, `blankVasistasFilled` INTEGER NOT NULL, `pathlists` TEXT, `cryptpart` TEXT, `coverPictureUrl` TEXT, `uris` TEXT, `coverPictureUri` TEXT, `sleepScoreValue` INTEGER, `sleepScoreStatus` INTEGER, `sleepScoreAlgoVersion` INTEGER, `duration_info_score` INTEGER, `duration_info_status` INTEGER, `recovery_info_score` INTEGER, `recovery_info_status` INTEGER, `interruptions_info_score` INTEGER, `interruptions_info_status` INTEGER, `timeToFallAsleep_info_score` INTEGER, `timeToFallAsleep_info_status` INTEGER, `timeToWakeUp_info_score` INTEGER, `timeToWakeUp_info_status` INTEGER, `regularity_info_score` INTEGER, `regularity_info_status` INTEGER, `snoring_info_score` INTEGER, `snoring_info_status` INTEGER, `night_heartrate_info_score` INTEGER, `night_heartrate_info_status` INTEGER, `distance` REAL, `averageSpeed` REAL, `minSpeed` REAL, `maxSpeed` REAL, `startLatitude` REAL, `startLongitude` REAL, `endLatitude` REAL, `endLongitude` REAL, `centerLatitude` REAL, `centerLongitude` REAL, `spanLatitudeDelta` REAL, `spanLongitudeDelta` REAL);
DELETE FROM sqlite_sequence;
CREATE INDEX `index_WorkoutLocation_userId_date` ON `WorkoutLocation` (`userId`, `date`);
CREATE INDEX `index_EcgMeasurement_userID_timestamp` ON `EcgMeasurement` (`userID`, `timestamp`);
COMMIT;
